import { generateUtilityClass, generateUtilityClasses } from '../className';
export function getListDividerUtilityClass(slot) {
  return generateUtilityClass('JoyListDivider', slot);
}
const listDividerClasses = generateUtilityClasses('JoyListDivider', ['root', 'insetGutter', 'insetStartDecorator', 'insetStartContent']);
export default listDividerClasses;
